// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

// this is for objects

contract AssignLevel{
    mapping(string => uint) public Levels;  // mapping for assinging levels
    // maps do not allow duplicate keys but key-value pair will be overwritten 
    mapping(bytes32 => uint) public Objects; // only hash of og evidence is stored and since hash is unique there are no chances of duplicacy 
    bytes32[] private Current_Evi; // store all registered objects' hash ,can do with block hash too ? but like why do i need to 
    
    // EVENTS
    event EvidenceRegistered(string, bytes32, uint);

    constructor(){  // casey's scaling  will start this from 1 to 7 cuz map allocates zero value to  all possible keys, 
        //so even if the qualification is not valid it will have a level of 0
        Levels["Certain"] = 7;
        Levels["Almost Certain"] = 6;
        Levels["Probable"] = 5;
        Levels["Somewhat Uncertain"] = 4;
        Levels["Highly Uncertain"] = 3;
        Levels["Possible"] = 2;
        Levels["Incorrect"] = 1;
    }
    
    
    function getLevel(string memory qualification) public view returns(uint){
        // in mapping all possible keys are considered and default values are set to 0 
        // so 0 can and will be returned in case of invalid qualification
        // maybe i can add an extra check and use og casey's scaling but like too much work 
        // it could be like qualification == "Incorrect" && levels[quali___] == 0 then assign it to evidence, maybe discuss it???
        return (Levels[qualification]);
    }
    
    function DoesExists (bytes32 key) public view returns(bool){  // check if evidence exists , high gas requirement , but it eezz what it eez 
        for(uint i =0; i<Current_Evi.length; i++){
            if(Current_Evi[i] == key){
                return true; 
            }
        }
        return false;
    }

    function setLevel(string memory qualification, bytes32 key) public payable{
        require(DoesExists(key) == false, "Evidence already added" );
        require(getLevel(qualification)> 0, "Invalid qualification");
        Objects[key] = getLevel(qualification);
        Current_Evi.push(key);
        emit EvidenceRegistered("Evidence Registered", key, Objects[key]);
    }

    function returnLevel(bytes32 key) public view returns(uint){
        require(DoesExists(key) == true, "Object does not exists");
        return Objects[key];
    }
}
